import React from 'react';
import  "../App.css"
import Login from './Login';


export default function Home() {
    return (
        <div className='img' >
            <img src="http://tipieapp.com/www/img/tipie-logo-01.png" alt="tipie" style={{"max-width":"100%", "justify-content":"center"}}/>
            <br/>
            <br/>
            <Link to="/invoices">Invoices</Link>
          <button type="button" className="btn btn-secondary btn-lg d-grid gap-2 col-6 mx-auto" to={<Login/>}>Login</button>
        </div>
    )
}
